import React, { Component } from 'react';
import { CardGroup, Col, Row } from 'reactstrap';
import Widget02 from './Widget02';

import libraryData from './LibraryData'

// Brand Card Chart
function LibraryItemCol(props) {
    const libraryItem = props.libraryItem
    const itemLink = `/Libary/${libraryItem.id}`
    const itemName = libraryItem.name
    const itemVersion = libraryItem.version
    return (
      <Col xs="12" sm="6" lg="3">
        <Widget02 header={itemName.toString()} mainText={itemVersion.toString()} icon="icon-folder-alt" color="green" footer link={itemLink} />
      </Col>
    )
  }

class Library extends Component {
  render() {

    const libraryItemList = libraryData.filter((libraryItem) => libraryItem.id)
    return (
      <div className="animated fadeIn">
        <Row>
          <Col xs="12" sm="6" lg="3">
            <Widget02 header="Data Science Workshop" mainText="HDP 3.0 (1 Node)" icon="icon-folder-alt" color="green" footer link="#/charts" />
          </Col>
          <Col xs="12" sm="6" lg="3">
            <Widget02 header="Personality Detection" mainText="HDP 3.0/HDF 3.2 (3 Nodes)" icon="icon-folder-alt" color="green" footer />
          </Col>
          <Col xs="12" sm="6" lg="3">
            <Widget02 header="Metron" mainText="HDP 3.0/HDF 3.2 (3 Nodes)" icon="icon-folder-alt" color="green" footer link="#/charts" />
          </Col>
          <Col xs="12" sm="6" lg="3">
            <Widget02 header="IoT Workshop" mainText="HDP 3.1/HDF 3.3 (3 Nodes)" icon="icon-folder-alt" color="green" footer />
          </Col>
        </Row>

      </div>
    );
  }
}

export default Library;
